INSERT INTO `fish` VALUES (NULL,NULL,1,NULL,'광어, 넙치라 불리며 가자미목 넙치과에 속하는 물고기이다. 수율은 45%~50% 정도 이며, 비린내가 적고, 담백하며 식감은 찰지고 쫄깃하다. 제철은 가을에서 겨울이지만 양식 광어의 경우 사시사철 맛의 편차가 적다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B4%91%EC%96%B4.png','광어'),(NULL,NULL,2,NULL,'도다리, 문치가자미라 불리며 가자미과에 속하는 물고기이다. 수율은 45%~50% 정도 이며, 담백하고, 뼈째 썰면 고소한 맛도 더해진다. 제철은 늦 여름부터 초 가을이지만 봄에 많이 잡히기 때문에 봄에도 많이 먹는 생선이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%8F%84%EB%8B%A4%EB%A6%AC.png','도다리'),(NULL,NULL,3,NULL,'가자미과에 속하는 물고기이다. 수율이 45%~50% 정도 이며, 맛은 평범하지만 식감이 일품이다. 제철은 겨울부터 초봄이다. ','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B0%95%EB%8F%84%EB%8B%A4%EB%A6%AC.png','강도다리'),(NULL,NULL,4,NULL,'찰광어, 터봇, 대문짝넙치라 불리며 대문짝넙치과 대문짝넙치속에 속하는 물고기이다. 수율은 45%~50% 정도 이며, 광어보다 살이 단단하다. 제철은 연중이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%B0%B0%EA%B4%91%EC%96%B4.png','찰광어'),(NULL,NULL,5,NULL,'우럭, 조피볼락이라 불리며 쏨뱅이목 양볼락과에 속하는 물고기이다. 수율은 25% 정도 이며, 회 뿐만 아니라 찜, 구이, 매운탕용으로도 애용된다. 제철은 가을에서 봄이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%9A%B0%EB%9F%AD.png','우럭'),(NULL,NULL,6,NULL,'참돔, 참도미라 불리며 도미목 도미과에 속하는 물고기이다. 수율은 35% 정도이며, 쫄깃하게 먹기 위해 껍질 부분만 뜨거운 물에 살짝 데쳐서 먹기도 한다. 제철은 봄에서 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%B0%B8%EB%8F%94.png','참돔'),(NULL,NULL,7,NULL,'감성돔, 감시, 감생이라 불리며 도미과에 속하는 물고기이다. 수율은 30% 정도이며, 특유의 단맛과 찰진 식감이 있다. 제철은 늦가을에서 봄이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B0%90%EC%84%B1%EB%8F%94.png','감성돔'),(NULL,NULL,8,NULL,'돌돔, 줄돔, 뺀찌라 불리며 농어목 돌돔과에 속하는 물고기이다. 수율은 35% 정도이며, 살이 단단하고 쫀득하다. 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%8F%8C%EB%8F%94.png','돌돔'),(NULL,NULL,9,NULL,'농어목 돌돔과에 속하는 물고기이다. 수율은 35% 정도이며, 살이 단단하고 쫀득하다. 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B0%95%EB%8B%B4%EB%8F%94.png','강담돔'),(NULL,NULL,10,NULL,'농어, 깔다구, 따오기라 불리며 농어목 농어과에 속하는 물고기이다. 수율은 35% 정도이며, 아삭한 식감이 특징이다. 제철은 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%86%8D%EC%96%B4.png','농어'),(NULL,NULL,11,NULL,'농어의 동종이명이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%A0%90%EB%86%8D%EC%96%B4.png','점농어'),(NULL,NULL,12,NULL,'점성어, 홍민어라 불리며 농어목 민어과에 속하는 물고기이다. ','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%A0%90%EC%84%B1%EC%96%B4.png','점성어'),(NULL,NULL,13,NULL,'자바리, 대왕자바리, 다금바리라고 불리며 농어목 바리과에 속하는 물고기이다. 수율은 35% 정도이며, 고급어종 중 하나이다. 제철은 늦봄부터 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%9E%90%EB%B0%94%EB%A6%AC.png','자바리'),(NULL,NULL,14,NULL,'농어목 바리과에 속하는 물고기이다. 수율은 40% 정도이며, 고급어종 중 하나이다. 제철은 늦봄부터 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%8A%A5%EC%84%B1%EC%96%B4.png','능성어'),(NULL,NULL,15,NULL,'농어목 바리과에 속하는 물고기이다. 수율은 40% 정도이며, 고급어종 중 하나이다. 제철은 여름부터 초가을이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%B6%89%EB%B0%94%EB%A6%AC.png','붉바리'),(NULL,NULL,16,NULL,'농어목 바리과에 속하는 물고기이다. 수율은 40% 정도이며, 고급어종 중 하나이다. 제철은 여름부터 초가을이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%B2%B5%EC%97%90%EB%8F%94.png','벵에돔'),(NULL,NULL,17,NULL,'벵에돔과에 속하는 물고기이다. 수율은 35% 정도이며, 고급어종 중 하나이다. 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B8%B4%EA%BC%AC%EB%A6%AC%EB%B2%B5%EC%97%90%EB%8F%94.png','긴꼬리벵에돔'),(NULL,NULL,18,NULL,'자주복, 복어, 참복이라 불리며 참복과에 속하는 물고기이다. 쫄깃한 식감이 특징이며, 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%B3%B5%EC%96%B4.png','복어'),(NULL,NULL,19,NULL,'숭어, 보리숭어, 참숭어라 불리며 숭어과에 속하는 물고기이다. 수율은 35% 정도이며, 차진 식감과 단맛이 특징이다. 제철은 겨울부터 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%88%AD%EC%96%B4.png','숭어'),(NULL,NULL,20,NULL,'가숭어, 밀치, 참수어라 불리며 숭어과에 속하는 물고기이다. 수율은 35% 정도이며, 쫄깃한 식감과 고소한 지방이 특징이다. 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EA%B0%80%EC%88%AD%EC%96%B4.png','가숭어'),(NULL,NULL,21,NULL,'전갱이과에 속하는 물고기이다. 수율은 35%~40% 정도이며, 고소한 지방이 특징이다. 제철은 겨울이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%B0%A9%EC%96%B4.png','방어'),(NULL,NULL,22,NULL,'전갱이과에 속하는 물고기이다. 수율은 35%~40% 정도이며, 쫄깃한 식감이 특징이다. 제철은 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EB%B6%80%EC%8B%9C%EB%A6%AC.png','부시리'),(NULL,NULL,23,NULL,'전갱이과에 속하는 물고기이다. 제철은 가을이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%EC%9E%BF%EB%B0%A9%EC%96%B4.png','잿방어'),(NULL,NULL,24,NULL,'흑점줄전갱이, 줄무늬전갱이, 시마아지라 불리며 전갱이과에 속하는 물고기이다. 제철은 여름이다.','https://fish-finder.s3.ap-northeast-2.amazonaws.com/fishImages/%ED%9D%91%EC%A0%90%EC%A4%84%EC%A0%84%EA%B0%B1%EC%9D%B4.png','흑점줄전갱이');
