INSERT INTO `post` VALUES ('2024-04-02 07:22:53.125014',NULL,'2024-04-02 07:22:53.673058',2,6,'참치 마싯다 헤헤','normal','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/2/7360992c-2d98-30c6-aa23-cac775173d5d.jpg','나 참다랑언데'),('2024-04-02 09:16:43.810621',NULL,'2024-04-02 09:16:43.963240',3,9,'광어회 먹으러 오길 정말 잘했네요 .. 다들 추천 드려요','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/3/8e787a5e-e54a-30c8-8cb8-68ce5fa233f7.jpg','노량수산 광어회가 너무 맛있어요!'),('2024-04-02 09:16:57.071555',NULL,'2024-04-02 09:16:57.384228',4,7,'물어바종 보고 참돔이 맛있다길래 노량진가서 참돔 2.5kg짜리 잡아서 먹고 왔습니다.\n가격도 적당하고 살도 오동통해서 맛있네요','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/4/f69513f2-8c0f-39e9-bbbb-9a9bc20fac6e.jpg','노량진에서 참돔 먹고 왔습니다.'),('2024-04-02 09:25:52.750148',NULL,'2024-04-02 09:25:52.750148',5,6,'눈이 노란 숭어','review',NULL,'가숭어도 맛있다'),('2024-04-02 09:26:41.471853',NULL,'2024-04-02 09:26:41.616551',6,9,'JMT','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/6/8e787a5e-e54a-30c8-8cb8-68ce5fa233f7.jpg','광어회 너무 조아요!!'),('2024-04-02 09:26:46.817849',NULL,'2024-04-02 09:26:47.004797',7,6,'눈이 노란 숭어\n(간이 안좋나봐)','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/7/45523255-d259-3698-96ea-862b0fab2589.jpg','가숭어도 맛있다!'),('2024-04-02 09:55:16.525071',NULL,'2024-04-02 09:55:17.007273',8,6,'비싸지만 맛있다!','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/8/0e0c5e4d-13bc-3d29-9db1-9458c79f7400.jpg','얼룩무늬 돌돔'),('2024-04-02 09:55:19.389593','2024-04-03 10:01:46.000000','2024-04-02 09:55:19.389593',9,9,'너무 맛있어요!! ','review',NULL,'참돔'),('2024-04-03 01:49:27.036462',NULL,'2024-04-03 01:49:27.190082',10,7,'노량진 참돔 굳','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/10/15ad9683-9cc9-3e31-ae92-82c91ccab14f.jpg','참돔 먹고 왔습니다.'),('2024-04-03 02:02:17.214308',NULL,'2024-04-03 02:02:17.214308',11,13,'노량진 수산시장을 이용하는 방법은 크게 세 가지가 있다.\r 1. 새벽 경매 시장 이용하기(가장 저렴)\r  새벽 3시 쯤 노량진 수산시장 경매장에 가면 경매를 진행한다. 경매에 참여할 수 없지만 경매장 옆에서 생선을 판매하는데 소비자가 구매하기 가장 저렴한 방법이다. 대신 회는 따로 손질해주지 않기 때문에 직접 손질하거나 손질 비용을 내고 손질을 받아야한다.\r  장점 : 매우 저렴하다. \r  단점 : 새벽에만 이용이 가능하다. 손질을 따로 해주지 않는다. \r 2. 도매점(초록 간판) 이용하기(두 번째로 저렴)\r  회를 뜨는 비용이 추가적으로 발생하지만 가격이 저렴하다. 회를 따로 손질해주지 않기 때문에 직접 손질하거나 손질 비용을 내고 손질을 받아야한다. 노량진 수산시장 1층 선어라고 적혀 있는 초록 간판 가게를 이용하면 된다.\r  장점 : 저렴하다.\r  단점 : 손질을 따로 해주지 않는다.\r \r 3. 일반 소매점(파란 간판) 이용하기(비싸지만 서비스가 좋음)\r  회도 손질해주고 서비스(맛보기 회, 와사비, 김 등)도 주기 때문에 소비자들이 가장 많이 이용하고 편하다. 대신 가격이 조금 비싸다.\r  장점 : 서비스와 편리함\r  단점 : 가격이 비쌈','normal',NULL,'노량진 수산시장 이용 꿀팁'),('2024-04-03 02:25:46.679936',NULL,'2024-04-03 02:25:47.310070',12,13,'봄도다리가 최고죠','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/12/ac129d9f-76b0-3438-964e-721d5ecb5db9.jpg','도다리회'),('2024-04-03 06:02:07.958668','2024-04-03 06:03:37.000000','2024-04-03 06:02:09.039469',13,6,'여러분 물어바종에 오신 것을 환영합니다!','normal','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/13/29150dad-92f3-39d1-ab9e-e79b02d5a074.jpg','안녕하세요~~'),('2024-04-03 06:04:55.771442',NULL,'2024-04-03 06:04:56.561217',14,6,'여러분 물어바종에 오신것을 환영합니다!\n많은 관심 부탁드려요!','normal','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/14/703085ed-ec52-3677-8d66-306ea7189c4b.jpg','물어바종 화이팅!'),('2024-04-03 06:12:33.477813',NULL,'2024-04-03 06:12:33.800065',15,6,'맛있습니다\n징짜루','review','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/15/7bffede1-9a0d-3430-8c32-aeee983c14a8.jpg','감성돔'),('2024-04-03 06:12:51.228561',NULL,'2024-04-03 06:12:52.229437',16,15,'소주 4병','normal','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/16/cb0ac9bd-e92f-3a8f-a746-81e9efd00dcc.jpg','참돔 진짜 개맛있음'),('2024-04-03 06:15:11.129487',NULL,'2024-04-03 06:15:11.129487',17,13,'노량진 수산시장을 이용하는 방법은 크게 세 가지가 있다.\n 1. 새벽 경매 시장 이용하기(가장 저렴)\n  새벽 3시 쯤 노량진 수산시장 경매장에 가면 경매를 진행한다. 경매에 참여할 수 없지만 경매장 옆에서 생선을 판매하는데 소비자가 구매하기 가장 저렴한 방법이다. 대신 회는 따로 손질해주지 않기 때문에 직접 손질하거나 손질 비용을 내고 손질을 받아야한다.\n  장점 : 매우 저렴하다. \n  단점 : 새벽에만 이용이 가능하다. 손질을 따로 해주지 않는다. \n 2. 도매점(초록 간판) 이용하기(두 번째로 저렴)\n  회를 뜨는 비용이 추가적으로 발생하지만 가격이 저렴하다. 회를 따로 손질해주지 않기 때문에 직접 손질하거나 손질 비용을 내고 손질을 받아야한다. 노량진 수산시장 1층 선어라고 적혀 있는 초록 간판 가게를 이용하면 된다.\n  장점 : 저렴하다.\n  단점 : 손질을 따로 해주지 않는다.\n \n 3. 일반 소매점(파란 간판) 이용하기(비싸지만 서비스가 좋음)\n  회도 손질해주고 서비스(맛보기 회, 와사비, 김 등)도 주기 때문에 소비자들이 가장 많이 이용하고 편하다. 대신 가격이 조금 비싸다.\n  장점 : 서비스와 편리함\n  단점 : 가격이 비쌈','normal',NULL,'노량진 수산시장 이용 꿀팁'),('2024-04-03 06:18:18.140110','2024-04-03 06:19:04.000000','2024-04-03 06:18:18.279653',18,12,'테스트','normal','https://fish-finder.s3.ap-northeast-2.amazonaws.com/thumbnail/18/d47bc1db-64c5-3f2d-a83a-2067ba7beda8.jpg','테스트'),('2024-04-03 11:43:42.955905','2024-04-03 11:43:44.000000','2024-04-03 11:43:42.955905',19,9,'안녕\n나는\n좌소연','normal',NULL,'안녕하세요?');
